import styled from "styled-components";

const Container = styled.div`
    margin: 0;
    background-color: blue;
    min-width: 250px;
`;

const Logo = styled.img`
    border: solid 1px black;
    width: 45px;
    height: 45px;
`;

export default function Sidebar() {
    return (
        <Container>
            <Logo></Logo>
        </Container>
    );
}
